import React, { Component } from 'react'
import CourseWork from '../CourseWork/CourseWork'

interface Idata{
    title?: string,
    teacher?: string,
    deadline?: string,
    scienceArea?: string,
    description?: string,
    reportFile?: string,
    presentationFile?: string,
    consultantReportFile?: string,
    link?: string,
    teacherContacts?: string,
    consultant?: string,
    consultantContacts?: string,
    critic?: string,
    status?: string
}

interface Props{
    data :Idata[]
}

interface State{

}

class CompletedWorks extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderCourseWork(work : Idata){
        return <CourseWork data={work}/>
    }

    private renderContentBar(){
        return(
            <div>
                <h1>COMPLETED</h1>
            </div>
        )
    }

    render(){
        return this.renderContentBar();
    }
}

export default CompletedWorks
